script: |
  super -f text -I q4590.spq | sort > q4590.out

inputs:
  - name: q4590.spq
    data: |
      SELECT ALL col1 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT + col0 IN ( + col1 * 18, 24 * - + ( 22 ), + + col1 * - col1 * col2 * - CAST ( + + col1 AS INTEGER ) );
  - name: tab0

outputs:
  - name: q4590.out
    data: |
      1
      21
      81
